import React from "react";
import * as S from "./styled";
const Heading1 = ({padding,margin,fontSize,  children, ...rest }) => {
  return <S.Heading1 {...rest}> {children}</S.Heading1>;
};

const Heading2 = ({padding,margin,fontSize, children, ...rest }) => {
  return <S.Heading2 {...rest} padding={padding}>{children}</S.Heading2>;
};
const Heading3 = ({ padding,margin,fontSize, children, ...rest }) => {
  return <S.Heading3 {...rest}>{children}</S.Heading3>;
};
const Text = ({ padding,margin, children, ...rest }) => {
  return <S.Text {...rest}>{children} </S.Text>;
};

export { Heading1, Heading2, Heading3, Text };
